webpackJsonp([0x9003382d1b14],{591:function(e,t){e.exports={data:{site:{siteMetadata:{title:"aendrew.com v8",author:"Aendrew Rininsland"}},markdownRemark:{id:"/Users/andrew.rininsland/Projects/OTHER/aendrew.github.io/src/pages/2011-11-07-city-j-tech-update-first-meeting-nov-8/index.md absPath of file >>> MarkdownRemark",html:"<p>Just a quick City University London Journalism Technology Exploration Group (CULJTEG) update — last week was supposed to be our first meeting, however, we’ve postponed it until tomorrow, Tues. November 8, at 5:00 p.m. given everyone was super drained following the six-hour public administration fun-for-all that day. </p>\n<p>So, to reiterate: very first City J-Tech meeting Tues., Nov. 8 at 5:00 p.m., Saddlers Bar on campus. All are welcome to attend regardless of technical ability, concentration or programme— the only prerequisite is a desire to improve reporting through technology.</p>\n<p>Tentative schedule:</p>\n<ol>\n<li>\n<p>Initial decisions: </p>\n<ul>\n<li>What should we call the group</li>\n<li>What will we focus on?</li>\n<li>Is Saddlers a good venue?</li>\n<li>\n<p>Who will champion this idea? </p>\n<ul>\n<li>I.e., who is willing to commit to promotion and being at every meeting?)</li>\n</ul>\n</li>\n</ul>\n</li>\n<li>Open discussion</li>\n</ol>",frontmatter:{title:"City J-Tech update -- first meeting Nov. 8!",date:"November 07, 2011"}}},pathContext:{path:"content/city-j-tech-update-first-meeting-nov-8"}}}});
